import React from 'react';
import { useHistory } from "react-router-dom";
import { Button, Form } from 'react-bootstrap';

class Login extends React.Component {

  constructor(props) {
    super(props);
    this.state = { password: "", email: "" };
  }

  handleChange = name => event => {
    this.setState({
      ...this.state,
      [name]: event.target.value,
    });
  };

  render() {
    return (
      <div>
        <Form onSubmit={(event) => this.handleSubmit(event)}>
          <Form.Group controlId="formEmail">
            <Form.Label>Email addresse</Form.Label>
            <Form.Control type="email" placeholder="Indtast email"
              value={this.state.email}
              onChange={this.handleChange('email')} />
          </Form.Group>
          <Form.Group controlId="formPassword">
            <Form.Label>Password</Form.Label>
            <Form.Control type="Password" placeholder="Indtast password"
              value={this.state.password}
              onChange={this.handleChange('password')} />
          </Form.Group>
          <Button variant="primary" type="submit" style={{ marginRight: '2%' }}>Login</Button>
          <Button variant="secondary" onClick={() => this.openRegister()}>Register</Button>
        </Form>
      </div>
    );
  }
}


export default Login;
